con:restMockAction.con:dispatchPath:
import groovy.json.JsonSlurper
def request = new JsonSlurper().parseText(mockRequest.getRequestContent().toString()) 

context['msgType'] = request.payloadType
context['msgId'] = request.msgId
context['targetId'] = request.payload.dealApplicationId ?: request.payload.targetObjectId

if(request.payload.dealApplicationId) {
	context.mockService.project.setPropertyValue('dealApplicationId', request.payload.dealApplicationId)
}

return 'DefaultResponse'
